    false,nt"url": null,nt"notes": "Preliminary fault map of Washington, Open
    File Report 80-2.The accompanying map is a preliminary compilation of major faults
    in the State of Washington. It was compiled at a scale of 1 :500,000 from published
    and open-file maps at scales of 1:24,000 to 1:500,000, after 'Ihich it was reduced
    to 1:1,000,000. The map shows only those faults 3 miles or longer. Known, concealed,
    and inferred faults are undifferentiated. Except for these simplifications, the
    compilation is an unaltered representation of each contributor's work. Large areas
    that appear free of faults reflect thick sedimentary cover as in the Puget Lowland
    and the Columbia Basin, or the presence of large granitic plutons as in the North
    Cascades and Okanogan Highlands. High fault density in any given area may be due
    to more extensive geologic mapping in that area, relative to surrounding areas.",nt"license_title":
